   "source": [
    "# Check normality using Shapiro-Wilk test\n",
    "for (col in c(\"Global_Avg_Temp\", \"CO2_Conc\", \"Rise_in_Sea_Lvl\", \"Arctic_Ice_Area\")) {\n",
    "  cat(\"\\nShapiro-Wilk test for\", col, \"\\n\")\n",
    "  print(shapiro.test(df[[col]]))\n",
    "}"
   ]
