    "  ggtitle(\"Global Average Temperature vs Arctic Ice Area\") +\n",
    "  scale_x_continuous(expand = c(0.001,0.001)) +\n",
    "  geom_smooth(method = \"lm\", se = FALSE, color = \"firebrick4\", linewidth = 0.4) +\n",
