     "text": [
      "\n",
      "\tPearson's product-moment correlation\n",
      "\n",
      "data:  df$CO2_Conc and df$Rise_in_Sea_Lvl\n",
      "t = 1.0901, df = 122, p-value = 0.2778\n",
      "alternative hypothesis: true correlation is not equal to 0\n",
      "95 percent confidence interval:\n",
      " -0.07948128  0.26985534\n",
      "sample estimates:\n",
      "       cor \n",
      "0.09821165 \n",
      "\n"
     ]
    },
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "[1] \"There is no significant correlation between CO2 concentration and Rise in sea level.\"\n"
     ]
    }
   ],
   "source": [
    "Corr_5 = cor.test(df$CO2_Conc,df$Rise_in_Sea_Lvl, method = \"pearson\")\n",
    "print(Corr_5)\n",
    "\n",
    "#Extracting P-value\n",
    "p_value = Corr_5$p.value\n",
    "\n",
    "#Hypothesis\n",
    "\n",
    "if (p_value < 0.05) {\n",
    "  print(\"There is a significant correlation between CO2 concentration and Rise in sea level.\")\n",
    "} else {\n",
    "  print(\"There is no significant correlation between CO2 concentration and Rise in sea level.\")\n",
    "}"
   ]
  },
