     "text": [
      "\n",
      "\tPearson's product-moment correlation\n",
      "\n",
      "data:  df$Arctic_Ice_Area and df$Rise_in_Sea_Lvl\n",
      "t = 1.4428, df = 122, p-value = 0.1516\n",
      "alternative hypothesis: true correlation is not equal to 0\n",
      "95 percent confidence interval:\n",
      " -0.04788164  0.29901616\n",
      "sample estimates:\n",
      "      cor \n",
      "0.1295285 \n",
      "\n"
     ]
    },
    {
     "name": "stdout",
     "output_type": "stream",
     "text": [
      "[1] \"There is no significant correlation between Arctic ice area and Rise in sea level.\"\n"
     ]
    }
   ],
   "source": [
    "Corr_6 = cor.test(df$Arctic_Ice_Area,df$Rise_in_Sea_Lvl, method = \"pearson\")\n",
    "print(Corr_6)\n",
    "\n",
    "#Extracting P-value\n",
    "p_value = Corr_6$p.value\n",
    "\n",
    "#Hypothesis\n",
    "\n",
    "if (p_value < 0.05) {\n",
    "  print(\"There is a significant correlation between Arctic ice area and Rise in sea level.\")\n",
    "} else {\n",
    "  print(\"There is no significant correlation between Arctic ice area and Rise in sea level.\")\n",
    "}"
   ]
  },
